- input: "TEXT\x1CC00188367\x1CTEXT-00001\x1C\x1CF3XA\x1CThis report includes a correction
    to the amount of one expenditure. The payroll check dated, August 31,2011, payable
    to Daniel  Stratton (Line 30b) was reported as $113.36. The check was actually
    for $113.56. The check did not clear the bank until September and therefore we
    did not identify the error until the September bank statement was balanced.  The
    receipts reported on Schedule A Line 15 from Wyden for Senate and Democratic National
    Committee are offsets for the payment of rent, telephone and copies. The Democratic
    Party of Oregon shares office space with several organizations. We write one check
    to pay rent. The amount of rent paid by each organization is assessed at the usual
    and normal charge, determinined by the amount of space occupied by the organization.
    Schedule A Line 15 reflects receipts from various County party and candidate committees.
    The Democratic Party of Oregon offers our County Committees and candidates  a
    number of technology services at cost.  These sevices include website and email
    services. Payments for salaries and wages reported on Schedule H4 are for employees
    who spent less than 25% of their time on FEA or activities in connection with
    a Federal election. Employees who spend more than 25% of their time on FEA or
    activities in connection with a Federal election are paid with 100% Federal funds
    as are their fringe benefits and reported on Line 30b.\n"
